// Navbar.js
import React, { useContext } from "react";
import { Link } from "react-router-dom";
import { motion } from "framer-motion"; 
import { AuthContext } from "./"; // Import AuthContext
import LoggedInNavbar from "./LoggedInNavbar"; // Import LoggedInNavbar component
import LoggedOutNavbar from "./LoggedOutNavbar"; // Import LoggedOutNavbar component
import "./Navbar.css";

const Navbar = () => {
  const { isLoggedIn } = useContext(AuthContext); // Get isLoggedIn state from AuthContext

  return (
    <ul className="navbar">
      <motion.li className="navbar-item" whileHover={{ scale: 1.1 }} whileTap={{ scale: 0.9 }}>
        <Link to="/">Home</Link>
      </motion.li>
      {isLoggedIn ? (
        <LoggedInNavbar />
      ) : (
        <LoggedOutNavbar />
      )}
    </ul>
  );
};

export default Navbar;
